import React,{Component} from "react";

class StateComponent extends Component {
    constructor(props) {
        super(props);
        this.state = { 
            name: "Cristian",
            apellido:"Ramirez"
         }
    }
    render() { 
        return ( 
            <>
            <h1>Estoy en StateComponent</h1>
            </>
         );
    }
}
 
export default StateComponent;
